text:
Прелестный малыш, так и захотелось потетешкаться__. Очаровательнвя мама, и кокошник очень идёт, картину "Мадонна с младенцем" писать можно. 
    Цены в Берлине:
 - билет в Королевскую Оперу на Бульваре под Липами 8 евро;
  - билет в Комишн Опера 40 евро; 
   - билет на спектакль Вари Шмыковой 50 евро. 
   Занавес.

Варя крутая!
"Хотела размечтаться!) А потом опустила себя с ног на землю." (с)
))

Не понравилась героиня, стойкое ощущение вранья и отторжение:
- я предприниматель; сколько стоит аренда? Кажется 1500;
- почему не смогла остаться? Потому что контекст переворот Вагнером (уехала за год до этого);
- почему пошла провожать отчима, телефон которого не знала и не общались? Хотела быть хорошей дочкой (с матерью, кстати, тоже не общалась на тот момент);
- я вижу в тебе маму-продюсера как Рудковская. Я не такая (завела за ребёнка инстаграм);
- почему ты вывела на съёмку в интервью Собчак всю семью? Мне хотелось показать им чего я добилась (по тексту поясняет что не такая уж и дружная семья)
И так по всему диалогу. Ребят, извините, дизлайк гостье, что-то в ней притворное
